        if not is_datetime64tz_dtype(arr.dtype):
            result = arr.astype('datetime64[ns]')
            result[arr == np.datetime64('NaT')] = np.nan
            return result
        else:
            raise ValueError("The dtype was a datetime64 dtype, but it had no unit.")

